import { Dialog, TextField, Typography ,Box, FormLabel,} from '@mui/material'
import React from 'react';


const AuthForm = () => {
  return (
    <Dialog open= {true}>
        <Typography variant="h4" textAlign={"center"}>
         Login
        </Typography>
        <form>
        <Box
          padding={6}
          display={"flex"}
          justifyContent={"center"}
          flexDirection="column"
          width={400}
          margin="auto"
          alignContent={"center"}
        >
            <FormLabel sx={{mt:1 ,mb:1}}>Email</FormLabel>
            <TextField  variant="standard" type="email" name='email'/>
            <FormLabel sx={{mt:1 ,mb:1}}>Password</FormLabel>
            <TextField variant="standard" type="password" name='password'/>
        </Box>
        </form>
    </Dialog>
  )
}

export default AuthForm
